import React from 'react';
import { Grid, Card, CardContent, CardHeader, Typography } from '@material-ui/core';
import Styles from './styles';

const FormRegister = props => {
	const classes = Styles();

	return(
		<Grid item sm={4}>
			<Card className={classes.card}>
				<CardContent>
					<Typography variant="h5" className={classes.titulo} component="h2">
		  				Tuxtla Gutierrez, Chis.
		  			</Typography>
		  			<Typography variant="body2" className={classes.titulo} component="h2">
		  				Sabado, 16:00
		  			</Typography>
		  			<Typography variant="body1" className={classes.titulo} component="h2">
		  				Mayormente nublado
		  			</Typography>
				</CardContent>
			</Card>
		</Grid>
	);
}

export default FormRegister;
